import React from "react";
import "./Chip.css";

import Tooltip from "@material-ui/core/Tooltip";

function Chip({ color, title, disabled }) {
  if(disabled ){
  return (
    <div
      className={disabled ? "disabled" : "chip"}
      style={{
        background: color,
      }}
    >
      {title}
    </div>
  )}
}

export default Chip;
